function pesquisarTabela(tabelaNome){const input=document.getElementById("inputPesquisa");var filtro=input.value.toLowerCase();const tabela=document.getElementById(tabelaNome);const linhas=tabela.getElementsByTagName("tr");for(let i=1;i<linhas.length;i++){let linha=linhas[i];let textoLinha=normalize(linha.textContent.toLowerCase());if(filtro===""){linha.classList.remove("hidden")}else{filtro=normalize(filtro);if(textoLinha.indexOf(filtro)>-1){linha.classList.remove("hidden")}else{linha.classList.add("hidden")}}}}function submitForm(){var formPesquisa=document.getElementById("formPesquisa");var inputValue=document.getElementById("inputPesquisa").value;console.log(inputValue);var url=new URL(formPesquisa.action);url.searchParams.append("textoBusca",inputValue);window.location.href=url;return false}function handleClickBg(){var collapseMenu=document.getElementById("collapseMenu");if(collapseMenu.style.display==="block"){collapseMenu.style.display="none"}else{collapseMenu.style.display="block"}}function loadSpinner(spinner){var el=document.getElementById("spinner"+spinner);if(el.classList.contains("hidden")){el.classList.remove("hidden")}}function normalize(str){return str.normalize("NFD").replace(/[\u0300-\u036f]/g,"").toLowerCase()}